import React from 'react';
import { Route, Link } from "react-router-dom";

const BoardList = ({ match }) => {
  <div>
    <h1>BoardList</h1>
    <ul>
      <li>
        <Link to={`${match.url}/1`}>Board 1</Link>
      </li>
    </ul>
  </div>
}

export default BoardList;
